import React from "react";
import { Link } from "react-router-dom";
import '../index.css'
import { AiOutlineRead, AiOutlineStar, AiOutlineCheck } from 'react-icons/ai'



export const OfferItem = ({ offer }) => {



    if (!offer) {
        return (
            <div className="postViewMain wrapper">
                <div className="circle"></div>
                <div className="circle"></div>
                <div className="circle"></div>
            </div>
        )
    } 

    return (
         <Link to={`/${offer._id}/one`} className='link-item'>
         <div className="offer-card">

                    <h3 className="postTitle">{offer.model}</h3>

                    <p>{offer.FirstName} {offer.LastName}</p>
            </div>
        </Link>

)}
